import React from "react";
import FirstBlock from "./blocks/firstblock"
import SecondBlock from "./blocks/secondblock"
import ThirdBlock from "./blocks/thirdblock";
import FourthBlock from "./blocks/fourthblock";


class Blocks extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            reportClick: false,
           answers: {
              first: {
                risk1: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk10: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                }
              },
              second:{
                risk2: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk3: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk4: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk8: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk11: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                }
              },
              third:{
                risk5: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk6: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk7: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk9: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                }
              },
              fourth: {
                risk12: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                },
                risk13: {
                    ans: 'none',
                    cat: -1,
                    number: -1
                }
              }
           }
        };
        this.handleBlock1 = this.handleBlock1.bind(this)
        this.handleBlock2 = this.handleBlock2.bind(this)
        this.handleBlock3 = this.handleBlock3.bind(this)
        this.handleBlock4 = this.handleBlock4.bind(this)
        this.ClickToReport = this.ClickToReport.bind(this)
     }

     ClickToReport = (event) => {
        if (event.target.tagName !== 'BUTTON') {
            this.setState((prevState) => ({
                reportClick: !prevState.reportClick
            }));
        }
    };

    handleBlock1 = (data) => {
        this.setState((prevState) => ({
            answers:{
                ...prevState.answers,
                first: {
                    risk1: {
                        ans: data.risk1Data.ans,
                        cat: data.risk1Data.cat,
                        number: data.risk1Data.number,
                    },
                    risk10: {
                        ans: data.risk10Data.ans,
                        cat: data.risk10Data.cat,
                        number: data.risk10Data.number,
                    }
                }
            }
        }));
    };

    handleBlock2 = (data) => {
        this.setState((prevState) => ({
            answers:{
                ...prevState.answers,
                second: {
                    risk2: {
                        ans: data.risk2Data.ans,
                        cat: data.risk2Data.cat,
                        number: data.risk2Data.number,
                    },
                    risk3: {
                        ans: data.risk3Data.ans,
                        cat: data.risk3Data.cat,
                        number: data.risk3Data.number,
                    },
                    risk4: {
                        ans: data.risk4Data.ans,
                        cat: data.risk4Data.cat,
                        number: data.risk4Data.number,
                    },
                    risk8: {
                        ans: data.risk8Data.ans,
                        cat: data.risk8Data.cat,
                        number: data.risk8Data.number,
                    },
                    risk11: {
                        ans: data.risk11Data.ans,
                        cat: data.risk11Data.cat,
                        number: data.risk11Data.number,
                    }
                }
            }
        }));
    };

    handleBlock3 = (data) => {
        this.setState((prevState) => ({
            answers:{
                ...prevState.answers,
                third: {
                    risk5: {
                        ans: data.risk5Data.ans,
                        cat: data.risk5Data.cat,
                        number: data.risk5Data.number,
                    },
                    risk6: {
                        ans: data.risk6Data.ans,
                        cat: data.risk6Data.cat,
                        number: data.risk6Data.number,
                    },
                    risk7: {
                        ans: data.risk7Data.ans,
                        cat: data.risk7Data.cat,
                        number: data.risk7Data.number,
                    },
                    risk9: {
                        ans: data.risk9Data.ans,
                        cat: data.risk9Data.cat,
                        number: data.risk9Data.number,
                    }
                }
            }
        }));
    };

    handleBlock4 = (data) => {
        this.setState((prevState) => ({
            answers:{
                ...prevState.answers,
                fourth: {
                    risk12: {
                        ans: data.risk12Data.ans,
                        cat: data.risk12Data.cat,
                        number: data.risk12Data.number,
                    },
                    risk13: {
                        ans: data.risk13Data.ans,
                        cat: data.risk13Data.cat,
                        number: data.risk13Data.number,
                    }
                }
            }
        }));
    };

    render(){
        const {answers} = this.state;
        return(
            <div class="Blocks">
                <FirstBlock onData={this.handleBlock1}/>
                <SecondBlock onData={this.handleBlock2}/>
                <ThirdBlock onData={this.handleBlock3}/>
                <FourthBlock onData={this.handleBlock4}/>
                <button className="report">Продолжить</button>
                <div>
                    <div>
                        <h3> Риск №1: Претензии супруга на земельный участок  </h3>
                        {answers.first.risk1.cat > -1 && (
                            <div>
                                <p>{answers.first.risk1.ans}</p>
                                <p>{answers.first.risk1.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №2: Отсутствие права собственности у Продавца </h3>
                        {answers.first.risk10.cat > -1 && (
                            <div>
                                <p>{answers.first.risk10.ans}</p>
                                <p>{answers.first.risk10.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №3: Неопределенность границ земельного участка </h3>
                        {answers.second.risk2.cat > -1 && (
                            <div>
                                <p>{answers.second.risk2.ans}</p>
                                <p>{answers.second.risk2.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №4: Целевое использование земельного участка </h3>
                        {answers.second.risk3.cat  > -1 && (
                            <div>
                                <p>{answers.second.risk3.ans }</p>
                                <p>{answers.second.risk3.cat }</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №5: Экология </h3>
                        {answers.second.risk4.cat > -1 && (
                            <div>
                                <p>{answers.second.risk4.ans}</p>
                                <p>{answers.second.risk4.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск № 6: Нечистая юридическая история земельного участка </h3>
                        {answers.second.risk8.cat > -1 && (
                            <div>
                                <p>{answers.second.risk8.ans}</p>
                                <p>{answers.second.risk8.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск № 7: Наличие обременений в отношении земельного участка </h3>
                        {answers.second.risk11.cat > -1 && (
                            <div>
                                <p>{answers.second.risk11.ans}</p>
                                <p>{answers.second.risk11.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №8: Банкротство продавца </h3>
                        {answers.third.risk5.cat > -1 && (
                            <div>
                                <p>{answers.third.risk5.ans}</p>
                                <p>{answers.third.risk5.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №9: Наличие исполнительных производств в отношении Продавца </h3>
                        {answers.third.risk6.cat > -1 && (
                            <div>
                                <p>{answers.third.risk6.ans}</p>
                                <p>{answers.third.risk6.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №10: Причастность к экстремизму и другим преступлениям </h3>
                        {answers.third.risk7.cat > -1 && (
                            <div>
                                <p>{answers.third.risk7.ans}</p>
                                <p>{answers.third.risk7.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №11: Продавец-Ответчик в судах общей юрисдикции </h3>
                        {answers.third.risk9.cat > -1 && (
                            <div>
                                <p>{answers.third.risk9.ans}</p>
                                <p>{answers.third.risk9.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №12: Доверенность </h3>
                        {answers.fourth.risk12.cat > -1 && (
                            <div>
                                <p>{answers.fourth.risk12.ans}</p>
                                <p>{answers.fourth.risk12.cat}</p>
                            </div>
                        )}
                    </div>
                    <div>
                        <h3> Риск №13: Невозможность самостоятельного принятия решения Продавцом. Принуждение к совершению сделки </h3>
                        {answers.fourth.risk13.cat > -1 && (
                            <div>
                                <p>{answers.fourth.risk13.ans}</p>
                                <p>{answers.fourth.risk13.cat}</p>
                            </div>
                        )}
                    </div>
                </div>
            </div>
        )
    }
}

export default Blocks
